import React from 'react';
import home from "../assets/home.jpeg";
import phones from "../assets/phones.png";
import {Button, Carousel, Image} from "react-bootstrap";


const Home = () => {
    return (

            <div style={{width: '50%'}} className="container">
                <Carousel variant="dark">
                    <Carousel.Item>
                        <img
                            className="d-block w-100"
                            src={home}
                            alt="First slide"
                        />
                        <Carousel.Caption>
                            <h5>Добро пожаловать</h5>
                            <p>Личный сайт фотографа</p>
                        </Carousel.Caption>
                    </Carousel.Item>
                    <Carousel.Item>
                        <img
                            className="d-block w-100"
                            src={home}
                            alt="Second slide"
                        />
                        <Carousel.Caption>
                            <h5>Second slide label</h5>
                            <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
                        </Carousel.Caption>
                    </Carousel.Item>
                    <Carousel.Item>
                        <img
                            className="d-block w-100"
                            src={home}
                            alt="Third slide"
                        />
                        <Carousel.Caption>
                            <h5>Third slide label</h5>
                            <p>Praesent commodo cursus magna, vel scelerisque nisl consectetur.</p>
                        </Carousel.Caption>
                    </Carousel.Item>
                </Carousel>

                <div style={{marginTop: 20}}>
                    <Button variant="primary">VK</Button>{''}
                    <Button style={{marginLeft: 10}}variant="danger">Instagram</Button>{''}
                    <Button style={{marginLeft: 10}}variant="info">Telegram</Button>{''}
                    <Button  style={{marginLeft: 10}}variant="warning">
                        <Image src={phones} style={{width: "70%", maxWidth: 30}} alt="phone"/>
                        <div className="ml-2" style={{textDecoration: "none", color: "black"}}></div>
                    </Button>
                </div>
            </div>



    // {/*<Image src={home} style={{width: "100%"}} alt="basket"/>*/}

    );
};

export default Home;
